import React, { useState, useEffect } from 'react'
import { OpersContainer, Table, Header, Cell, Button, Row, Title } from './StyleAllTransferences';
import axios from 'axios';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Typography from '@material-ui/core/Typography';
import RequestService from './../../services/RequestService';
import { sobregirosCols, transCols }  from './../listas/TablesInfo';
import TableGrid  from './../listas/TableGrid';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    '& .super-app-theme--header': {
      backgroundColor: '#77ADDD',
      fontSize: 16,
      color: 'white'
    },
    '& .super-app-theme--header2': {
      backgroundColor: '#CFE7FE',
      fontSize: 16,
      color: 'black'
    },
    '& .trans-app-theme--header': {
      backgroundColor: '#F7F3E3',
      fontSize: 16,
      color: 'black'
    },
    '& .trans-app-theme--header2': {
      backgroundColor: '#ECC9A4',
      fontSize: 16,
      color: 'white'
    },
  },
});

const AllOperations = () => {

  const[cuenta, setCuenta] = useState("");
  const[lista, setLista] = useState([]);

  useEffect(() => {
    const componentDidMount = async () => {

      await RequestService.post("/clients/user/operations", null)
      .then(response => {
        if (!response.ok) {
          return
        }
        return response
      })
      .then(response => response.json())
      .then(data => {
        setLista(data.success)
      })
    };
    componentDidMount();
  }, []);

  const classes = useStyles();

  return (
    <div>
      <OpersContainer>
        <Title>
          Mis movimientos
        </Title>
        <br /><br />

        {  lista.length === 0 ? (

          <React.Fragment>
            <Typography
              component="span"
              variant="body2"
              color="textPrimary"
              >
                No hay movimientos
              </Typography>

            </React.Fragment>

          ) : (
            <div>
              <TableGrid columns={transCols} rows={lista} pageSize={10} divStyle={{ height: 400, width: '100%', textAlign: "center"}} className={classes.root} />
            </div>
          )
        }

      </OpersContainer>
    </div>

  );
}

export default AllOperations;
